description:
Para quem busca tecnologia, acessibilidade e mobilidade, tudo em um único Notebook.

O Notebook Ultra UB440, além de possuir Windows 11 Home, conta com:

- 4GB de Memória RAM e 120GB SSD, entregando uma velocidade maior na utilização diária e armazenamento para suprir a necessidade de quem precisa de espaço para suas fotos, vídeos e arquivos no dia a dia;
- Com Processador Intel i3 de 10th geração, é ideal para quem quer tecnologia e potência aliadas à mobilidade;
- Tecla de atalho Netflix;
- Touch pad numérico.

Aproveite e leve também a Case forrada internamente e com bolso externo para acessórios. Proteja seu notebook contra impactos e arranhões!

- Material Neoprene com forro interno acolchoado;
- Notebook até 15,6 polegadas;
- Bolso frontal com zíper.

Garanta já o seu!

Imagens meramente ilustrativas.
